// FUNCTION ///////////////////////////////////////////////////////////////////
function calculate_ungapped_nucleotide_statistics(match, mismatch) {
  const stats = { };
  const expected_score = match * 0.25 + mismatch * 0.75;
  let Pn = 0.25;
  let lambda = 1;
  let high = 2;
  let low = 0;
  while (high - low > 0.001) {
    let sum = Pn * Pn * Math.exp(lambda * match) * 4 + Pn * Pn * Math.exp(lambda * mismatch) * 12;
    if (sum > 1) {
      high = lambda;
      lambda = (lambda + low) / 2;
    } // end if
    else {
      low = lambda;
      lambda = (lambda + high) / 2;
    } // end else
  } // end while
  let targetID = Pn * Pn * Math.exp(lambda * match) * 4;
  let h = lambda * match * targetID + lambda * mismatch * (1 - targetID);
  stats.lambda = parseFloat(lambda.toFixed(3));
  stats.h = parseFloat(h.toFixed(3));
  stats.target_id = parseFloat(targetID.toFixed(3));
  return stats;
} // end function
